  \"Oceanographic profile data collected from CTD and sound velocimeter - moving vessel
  profiler casts aboard FAIRWEATHER as part of project OPR-R365-FA-10 in the Bering
  Sea, Coastal Waters of SE Alaska, Gulf of Alaska and North Pacific Ocean from 2010-06-14
  to 2010-09-16 (NCEI Accession 0130667)\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-02-26T22:17:11.817848\",\n\t\"name\": \"oceanographic-profile-data-collected-from-ctd-and-sound-velocimeter-moving-vessel-profiler-0bf97\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130667 includes physical
  and profile data collected aboard the FAIRWEATHER during project OPR-R365-FA-10
  in the Bering Sea, Coastal Waters of SE Alaska, Gulf of Alaska and North Pacific
  Ocean from 2010-06-14 to 2010-09-16. These data include CONDUCTIVITY, HYDROSTATIC
  PRESSURE, SALINITY, SOUND VELOCITY, WATER DENSITY and WATER TEMPERATURE. The instruments
  used to collect these data include CTD and sound velocimeter - moving vessel profiler.
  These data were collected and submitted by the NOAA Office of Coast Survey in support
